import './App.css';
import React, { useEffect }  from 'react';
import { useNavigate } from 'react-router-dom';

export function App() {
  const navigate = useNavigate();
  useEffect(()=>{
    const fun=() => {

      if(localStorage.getItem('token') !== null)
      {
        navigate('/sign');
      }

    };
    fun();
  },[]);
  return (
    <div >
      <h1>ji</h1>
    </div>
  );
}

export default App;
